import React from 'react'

function Card(props) {
    const { item }=props;
    return (
        <div key={item.id_} className="card">
        <h1>hello item.heading</h1>
        <img src={item.img}/>
        <h2>${item.heading}</h2>
        <p>{item.description}</p>
        </div>
    )
}

export default Card
